public int compareTo(DurationField otherField) {
long otherMillis = otherField.getUnitMillis();
long thisMillis = getUnitMillis();
if (thisMillis == otherMillis) {
return 0;
if (thisMillis < otherMillis) {
return 1;
}

public int getOffset(long millis) {
if (iNextInfo == null || millis < iNextInfo.iPeriodStart) {
if (iOffset == Integer.MIN_VALUE) {
iOffset = iZoneRef.getOffset(iPeriodStart);
return iOffset;
}

public static DurationFieldType days() {
return DAYS_TYPE;
}

private static DateTimeFormatter createFormatterForPattern(String pattern) {
if (pattern == null || pattern.length() == 0) {
DateTimeFormatter formatter = null;
synchronized (cPatternedCache) {
formatter = cPatternedCache.get(pattern);
if (formatter == null) {
DateTimeFormatterBuilder builder = new DateTimeFormatterBuilder();
parsePatternTo(builder, pattern);
formatter = builder.toFormatter();
cPatternedCache.put(pattern, formatter);
}
return formatter;
}

public final DurationField days() {
return iDays;
}

long getTotalMillisByYearMonth(int year, int month) {
if (isLeapYear(year)) {
return MAX_TOTAL_MILLIS_BY_MONTH_ARRAY[month - 1];
return MIN_TOTAL_MILLIS_BY_MONTH_ARRAY[month - 1];
}

public static final void setCurrentMillisFixed(long fixedMillis) throws SecurityException {
checkPermission();
cMillisProvider = new FixedMillisProvider(fixedMillis);
}
